import React, {Component} from 'react';
import PostData from './post.json';

class Postlist extends Component{
render() {
    // 'e' is element and 'i' is element index number
    return (
      <div>
        <h1>todo json App </h1>
        {PostData.map((Postdetais,index)=>{
            return <h1>{Postdetais.title}</h1>
          })}
      </div>
    )
  }
}

export default Postlist;
